  \"Ocean currents measured by Shipboard Acoustic Doppler Current Profilers (SADCP)
  from global oceans accumulated at Joint Archive for SADCP from 2004 to 2013 (NODC
  Accession 0123302)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-02-26T22:16:54.374052\",\n\t\"name\": \"ocean-currents-measured-by-shipboard-acoustic-doppler-current-profilers-sadcp-from-global-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Absolute U- and V-component ocean current
  vectors from Shipboard AcousticDoppler Current Profilers (SADCP), as both a high-frequency
  sampling(nominally 5 minutes with 8 m depth bins) and an averaged subset (hourly
  timeand 10 m depth means), are provided for the global oceans. The depth range istypically
  from 20 to 300 m although recent technology has allowed penetrationto over 1 km.
  The high frequency samples along with ancillary parameters areprovided in the Common
  Oceanographic Data Access System (CODAS) binary format.The standard (averaged) subset
  is stored in ASCII. These data, collected from2004-04-06 to 2013-12-23, represent
  the cruises acquired from 2012-07through 2014-11 at the Joint Archive for SADCP,
  a collaboration ofNOAA and the E.Firing ADCP Laboratory at the University of Hawaii.
  The datahave been contributed by both US and international organizations. A total
  of362 unique SADCP sets on 18 ships (7.1 gigabytes) are included.\",\n\t\"license_title\":
